import Navbar from './components/Navbar';

import './App.css';

function App() {
  return (
    <div>
      <Router>
        <Navbar/>
          <Switch>
            <Route path={'/AboutUs'} component={AboutUs}></Route>
            <Route path={'/ContactUs'} component={ContactUs}></Route>
            <Route path={'/'} component={Home}></Route>
          </Switch>

      </Router>
    </div>
  ); 
}

export default App;
